script: |
  super -f text -I q7103.spq | sort > q7103.out

inputs:
  - name: q7103.spq
    data: |
      SELECT ALL - 24 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 85 + + - col2 + - col2 >= ( - col1 );
  - name: tab2

outputs:
  - name: q7103.out
    data: |
      -24
      -24
      -24
